import React, {Fragment} from 'react';
import Navberr from '../nav_component/Nav';
import TodoApp from './todo';

 const TodosApp = (props) => {
     console.log(props.todosProps);
    return (
        <Fragment>
                 <Navberr />
                 <section>
                    {
                         props.todosProps.map((todo) => <TodoApp key={todo.id}/>)
                    }
                 </section>
             </Fragment>
    );
};
export default TodosApp;
